아,, 진짜 너무 하네요;;

누가 봐도 환불된 상품인데 이걸 다시 보냇네요,,
상단 부분이 까져잇는걸 그냥 다시 보냇내요

귀찬아서 걍 테이블보 덮어서 쓸려고 합니다;

싼 게 비지떡이라고 괜히 돈 아끼려다가 ,, 후회합니다
제품은 조립하면 예뻐요 근데 조립 구멍들이 맞는 부분이 없어서 다른 곳에 구멍 뚫어 나사 박았습니다
테이블과 다리를 이어주는 곳도 튼튼하지도 않고 배송 온 날 다리 한 쪽 지탱해 주는 곳은 우직 하면서 부러졌습니다 다리 세개에 한개는 거의 받혀놓은 셈이죠 ,,; 잘 좀 확인하고 보내세요 제발 ;
